drop table if exists download_stats;

create table download_stats (
	id INT AUTO_INCREMENT PRIMARY KEY,
	video_id CHAR(15),
	title VARCHAR(50),
	artist VARCHAR(50),
	album VARCHAR(50),
	ip_address VARCHAR(20),
	country VARCHAR(50),
	format VARCHAR(10),
	start_at CHAR(9),
	end_at CHAR(9),
	direct_download TINYINT,
	bitrate INT,
	operating_system VARCHAR(25),
	browser VARCHAR(25),
	timestamp DATETIME
);

